import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const decks = [
  {
    id: 1,
    name: 'Deck 1',
    flashcards: [
      { id: 1, frontContent: 'Full name ni allen?', backContent: 'BOGART GYATT MACASPAC' },
      { id: 2, frontContent: 'huh?', backContent: 'huhtdog kwento mo sa pagong' },
    ],
  },
  {
    id: 2,
    name: 'Deck 2',
    flashcards: [
      { id: 1, frontContent: 'shibal', backContent: 'uwu' },
      { id: 2, frontContent: 'a', backContent: 'b' },
    ],
  },
];

const App = () => {
  return (
    <View style={styles.container}>
      {decks.map((deck) => (
        <View key={deck.id} style={styles.deck}>
          <Text style={styles.deckTitle}>{deck.name}</Text>
          {deck.flashcards.map((flashcard) => (
            <View key={flashcard.id} style={styles.flashcard}>
              <Text>Front: {flashcard.frontContent}</Text>
              <Text>Back: {flashcard.backContent}</Text>
            </View>
          ))}
        </View>
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    backgroundColor: '#f4f4f4',
  },
  deck: {
    borderWidth: 1,
    borderColor: '#ccc',
    borderRadius: 5,
    marginBottom: 20,
    padding: 10,
  },
  deckTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  flashcard: {
    borderWidth: 1,
    borderColor: '#ddd',
    borderRadius: 5,
    marginBottom: 10,
    padding: 10,
    backgroundColor: '#fff',
  },
});

export default App;
